e.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"below":[{"id":"1081"}],"center":[{"id":"1084"},{"id":"1088"}],"left":[{"id":"1085"}],"renderers":[{"id":"1102"}],"sizing_mode":"stretch_both","title":{"id":"1222"},"toolbar":{"id":"1094"},"x_range":{"id":"1073"},"x_scale":{"id":"1077"},"y_range":{"id":"1075"},"y_scale":{"id":"1079"}},"id":"1072","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1040","type":"DataRange1d"},{"attributes":{},"id":"1005","type":"DataRange1d"},{"attributes":{"dimensions":"width"},"id":"1138","type":"WheelZoomTool"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"bandwidth","transform":{"id":"1146"}},"height":{"units":"data","value":1},"line_alpha":{"value":0.1},"line_color":{"field":"bandwidth","transform":{"id":"1146"}},"width":{"units":"data","value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1167","type":"Rect"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1277"},"selection_policy":{"id":"1276"}},"id":"1178","type":"ColumnDataSource"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;p&gt;&lt;b&gt;Source:&lt;/b&gt; @source &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Destination:&lt;/b&gt; @destination &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Bandwidth:&lt;/b&gt; @bandwidth_text / s&lt;/p&gt;\n            &lt;/div&gt;\n            "},"id":"1176",
